function Home() {
  return (
    <div>
    <h1>Welcome to EUH JpHack</h1>
    <h2>Let's get started</h2>
      <ul>
        <li><a href="/login">ログイン</a></li>
        <li><a href="/signup">サインアップ</a></li>
        <li><a href="/profile">プロフィール</a></li>
        <li><a href="/recommendations">おすすめ</a></li>
        <li><a href="/chat">トーク</a></li>
      </ul>
    </div>
  );
}
